import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';
import { GooglePlacesAutocomplete } from '@react-google-maps/api';
import { useState } from 'react';


const GoogleMaps = () => {

    const [places, setPlaces] = useState([]);
    const onLoad = (autocomplete) => console.log('autocomplete: ', autocomplete);
    const onPlaceChanged = () => {
        const place = GooglePlacesAutocomplete.getPlace();
        setPlaces([place]);
    };

    const mapStyles = {
        height: "100vh",
        width: "100%"
    };

    const defaultCenter = {
        lat: 40.4165000, lng: -3.7025600
    }

    return (
        <div>
            <h3>Encuentra centros de adopción cercanos</h3>
            <LoadScript
                googleMapsApiKey='AIzaSyDiT0oMbPlcoyQWL8eCXMiE71TmL1QYdOE'
                libraries={["places"]}>

                <GooglePlacesAutocomplete
                    onLoad={onLoad}
                    onPlaceChanged={onPlaceChanged}
                >
                    {/*
    Tu código aquí
    */}
                </GooglePlacesAutocomplete>

                <GoogleMap
                    mapContainerStyle={mapStyles}
                    zoom={13}
                    center={defaultCenter}
                >
                    {places.map(place => (
                        <Marker
                            key={place.id}
                            position={{
                                lat: place.geometry.location.lat(),
                                lng: place.geometry.location.lng(),
                            }}
                        />
                    ))}
                </GoogleMap>
            </LoadScript>
        </div>
    )
}

export default GoogleMaps
